    false,nt"url": null,nt"notes": "This memorandum is conveying information
    about the Audubon National Wildlife Refuge objectives for the 1000 acre Monitoring
    Program and grassland management on the complex. It has several documents attached
    that provide a brief overview of the current grassland management on the refuge.
     Attachments include background information from a South Dakota State University
    Waterfowl Ecology and Management class, annual surveys for biological monitoring,
    farming program, burning program, grazing program, grassland management program.
     Nesting and grazing data is also included for Haugeberg, Otis, Turtle Lake, Weishaar,
